import '../../Styles/FaqCard.css';


// Dictionary for fruit images
const fruitImages = {
    Apple: 'data:image/jpeg;base64,',
    Banana: 'data:image/jpeg;base64,',
    Bananas: 'data:image/jpeg;base64,',
    Orange: 'data:image/jpeg;base64,',
    Mango: 'data:image/jpeg;base64,',
    Grapes: 'data:image/jpeg;base64,',
    Rambutan: 'data:image/jpeg;base64,',
    Durian: 'data:image/jpeg;base64,',
    Strawberries: 'data:image/jpeg;base64,',
    Strawberry: 'data:image/jpeg;base64,',
    Starfruit: 'data:image/jpeg;base64,',
    Dragon: 'data:image/jpeg;base64,',
    Lychee: 'data:image/jpeg;base64,',
    Mangosteen: 'data:image/webp;base64,',
    Pineapple: 'data:image/webp;base64,',
    Papaya:'data:image/webp;base64,',

};

const FaqCard = ({ id, title, image, question, answer, onEdit, onDelete }) => {

    const imageUrl = fruitImages[title] || 'https://i.ibb.co/zGVJ0Gd/jamie-street-tb5-A-QTI6xg-unsplash.jpg'; // Default image 

    return(
        <div className='faq-card'>
            <div className='faq-card-left-section'>
                <img className='faq-card-img' src={`${imageUrl}`}/>
            </div>
            <div className='faq-card-right-section'>
                <div className='font-bold text-xl'>{title}</div>
                <div className='font-semibold text-lg text-left'>Que : {question}</div>
                <div className='text-left'>{answer}</div>
            </div>
            <div className='faq-card-buttons-section flex-column content-center space-y-3'>
                <div className='text-sm font-semibold cursor-pointer text-blue-600 hover:underline' onClick={() => onEdit(id, title, question, answer)}>
                    Edit
                </div>
                <div className='text-sm font-semibold cursor-pointer text-red-500 hover:underline' onClick={() => onDelete(id)}>
                    Delete
                </div>
            </div>
        </div>
    )
}

export default FaqCard;